const { $, expect } = require('@wdio/globals')
const Page = require('./page');

/**
 * sub page containing specific selectors and methods for a specific page
 */
class HoversPage extends Page {
    /**
     * define selectors using getter methods
     */
    get hoversPageTitle() {
        return $('h3');
    }

    get allUsers() {
        return $$('.figure');
    }

    async assertTitle() {
        await expect(this.loginPageTitle).toBeDisplayed();
        await expect(this.loginPageTitle).toHaveText("Hovers");
    }

    async assertAllUsers() {

        // assert all users avatar
        this.allUsers.forEach(async (avatar, index) => {
            avatar.moveTo();
            const userInfo = $(`.example .figure:nth-child(${index + 1}) .figcaption h5`);
            const username = userInfo.getText();

            // Click the user link
            userInfo.click();

            // Wait for the "Not Found" text to appear on the page
            browser.waitUntil(() => {
                return $('h1=Not Found').isDisplayed();
            }, { timeout: 5000, timeoutMsg: 'User profile not found.' });

            await expect(browser).toHaveUrlContaining(`/users/${index + 1}`);

            // Navigate back to the previous page
            browser.back();
        });
    }

    /**
     * overwrite specific options to adapt it to page object
     */
    open() {
        return super.open('hovers');
    }
}

module.exports = new HoversPage();

